char libwordle_isvalid(const char* word) {
  int i, j, n, prefix, suffix;
  // make sure it's exactly five letters A-Z
  for (i=0; i<5; i++) {
    char ch = word[i];
    if (ch < 'A' || ch > 'Z') return 0;
  }
  if (word[5] != '\0') return 0;
  // get prefix index
  prefix = LETTER(word[0]) * 26 + LETTER(word[1]);
  if (n = WORD_BINS[prefix]) {
    j = 0;
    for (i=0; i<prefix; i++) {
      j += WORD_BINS[i];
    }
    // get suffix code to match
    suffix = LETTER(word[2]) + (LETTER(word[3])<<5) + (LETTER(word[4])<<10);
    for (i=0; i<n; i++) {
      if (WORD_LAST3[j++] == suffix) return 1;
    }
  }
  return 0;
}

char libwordle_initindex(Wordle* state, int targetIndex) {
  int i, j, k, binsize;
  char word[6];
  j = 0;
  word[0] = 'A';
  word[1] = 'A';
  binsize = WORD_BINS[0];
  for (i=0; i<NUMWORDS; i++) {
    while (binsize-- == 0) {
      binsize = WORD_BINS[++j];
      if (++word[1] > 'Z') {
        ++word[0];
        word[1] = 'A';
      }
    }
    k = WORD_LAST3[i];
    if (k & 0x8000) {
      if (targetIndex-- == 0) {
        word[2] = ((k >> 0) & 31) + 'A';
        word[3] = ((k >> 5) & 31) + 'A';
        word[4] = ((k >> 10) & 31) + 'A';
        word[5] = 0;
      printf("%s", word);
        libwordle_init(state, word);
        return 1;
      }
    }
  }
  return 0;
}

#endif

void libwordle_init(Wordle* state, const char* word) {
  memset(state, 0, sizeof(Wordle));
  memcpy(state->target, word, 5);
}

char libwordle_update(Wordle* state, const char* guess) {
  int i, j, correct;
  if (!libwordle_isvalid(guess)) {
    return 0;
  }
  correct = 0;
  for (i=0; i<5; i++) {
    char result = GUESS_GREY;
    char letter = guess[i];
    if (letter == state->target[i]) {
      result = GUESS_GREEN;
      correct++;
    } else {
      for (j=0; j<5; j++)
        if (letter == state->target[j])
          result = GUESS_YELLOW;
    }
    state->guesses[i] = result;
    state->status[LETTER(letter)] |= 1 << result;
  }
  return correct == 5 ? 2 : 1;
}


#ifdef __MAIN__

#include <stdlib.h>
#include <ctype.h>

static Wordle w;

void test_word(const char* word) {
  printf("%8s: %d\n", word, libwordle_isvalid(word));
}

int test_guess(const char* word) {
  int i, s, result;
  textcolor(COLOR_WHITE);
  result = libwordle_update(&w, word);
  printf("%8s: %d -> ", word, result);
  for (i=0; i<5; i++) {
    printf("%d ", w.guesses[i]);
  }
  for (i=0; i<26; i++) {
    if (s = w.status[i]) {
      if (s & 1) textcolor(COLOR_BLACK);
      if (s & 2) textcolor(COLOR_YELLOW);
      if (s & 4) textcolor(COLOR_GREEN);
      printf("%c", i+'A');
      textcolor(COLOR_WHITE);
    }
  }
  printf("\n");
  return result;
}

void play(void) {
  char buf[6];
  int iter = 1;
  int i, result;
  
  libwordle_initindex(&w, ((unsigned int)rand()) % NUMWORDS);
  printf("Word is: %s\n", w.target);
  do {
    printf("\nGuess %d: ", iter);
    gets(buf);
    for (i=0; i<5; i++) {
      buf[i] = toupper(buf[i]);
    }
    result = test_guess(buf);
    if (result == 0) continue;
    if (result == 2) break;
  } while (++iter <= 7);
}

void main(void) {
  clrscr();
  printf("\r\nWordle Library Test\r\n\r\n");
  libwordle_initindex(&w, 0);
  test_guess("ABBEY");
  libwordle_initindex(&w, 500);
  test_guess("MOVED");
  libwordle_initindex(&w, 911);
  test_guess("YOUTH");
  libwordle_init(&w, "CREEP");
  test_guess("ABCDE");
  test_guess("MONAD");
  test_guess("CLONE");
  test_guess("CREPE");
  test_word("BAD");
  test_word("BADDDD");
  test_word("bAd!!");
  test_word("AAHED");
  test_word("AALII");
  test_word("MONAD");
  test_word("ZYMES");
  test_word("AAAAA");
  test_word("ZZZZZ");
  test_word("CREDP");
  play();  
}

#endif

